Professor Palmtree - Mystery of The Tacho Plant

Carlsen Comics, 1981, 48 pages

Written and Illustrated by Dick Briel

Whilst in London, Professor Palm Tree and his assistant Marcus Wyld attend a lecture. During a midnight walk, they discover a man on the banks of the Thames, half-frozen and unconscious. So begins a fantastic adventure involving a  disappearing botanist, an enigmatic virtuoso pianist, and the mystery of the Tacho plant...

Professor Palmboom (literally translated as Professor Palm Tree) is a comic album series written and drawn by Dutch artist Dick Briel. They are illustrated in the ligne claire style. So far, three albums have been released and one book. They follow the adventures of Professor Julius Palmboom.
